import Paper from '@material-ui/core/Paper';
import './App.scss';
import { Route, Switch, Redirect, Router, Link } from 'react-router-dom';

const theme = createMuiTheme({
    palette: {
    //type:'dark'
    },

  });

const Nav = () =>(
    <ThemeProvider theme={theme}>
    <Router> 
  <Switch>


    <nav>
    <ul>
    <Link to='/Header'><li>Home</li></Link> 
    <Route path='/Header' />
    <li>Products</li>
    <li>Prices</li>
    <li>Contact</li>    
    </ul>
    </nav>
    </Switch>

  </Router>
    </ThemeProvider>
    )
    export default Nav;
